eval("module.exports = JSON.parse('{\"en\":{\"main_title\":\"The Chartres Cathedral\",\"title\":\"The Chartres Cathedral\",\"years\":\"1145-1194\",\"text1\":\"The Chartres Cathedral is a milestone in the development of Western architecture because it employs all the structural elements of the new Gothic architecture: the pointed arch; the rib-and-panel vault; and, most significantly, the flying buttress.\",\"text2\":\"Because most of its 12th-and 13th-century stained glass and sculpture survives, Chartres Cathedral is one of the most completely surviving medieval churches. Its spiritual intensity is heightened by the fact that no direct light enters the building. All the light is filtered through stained glass, so that the whole experience of visiting the Chartres Cathedral seems out of this world.\",\"text3\":\"The interior of the Chartres cathedral is remarkable. The nave, wider than that of any other cathedral in France (52 feet, or 16 meters), is in the purest 13th-century ogival style.  In its center is a maze, the only one still intact in France, with 320 yards (290 meters) of winding passages, which the faithful used to follow on their knees.\"},\"ua\":{\"main_title\":\"Шартрський собор\",\"title\":\"Шартрський собор\",\"years\":\"1145-1194\",\"text1\":\"Шартрський собор є віхою в розвитку західної архітектури, оскільки в ньому використані всі конструктивні елементи нової готичної архітектури: стрілчаста арка; ребристий звод; і, що особливо важливо, літаючий контрфорс.\",\"text2\":\"Оскільки більшість вітражів і скульптури 12-го і 13-го століть збереглася, Шартрський собор є однією з найбільш повно збережених середньовічних церков. Його духовна інтенсивність посилюється через те, що в будівлю не потрапляє пряме світло. світло фільтрується через вітражі, так що весь досвід від відвідування Шартрського собору здається не з цього світу.\",\"text3\":\"Інтер\\'єр Шартрського собору дивовижний. Неф, ширший, ніж будь-який інший собор у Франції (52 фути або 16 метрів), виконаний у найчистішому огівальному стилі 13-го століття. У центрі його лабіринт, єдиний досі неушкоджений у Франції, з 320 ярдами (290 метрів) звивистих проходів, по яких вірні ходили на колінах.\"},\"es\":{\"main_title\":\"La Catedral de Chartres\",\"title\":\"La Catedral de Chartres\",\"years\":\"1145-1194\",\"text1\":\"La catedral de Chartres es un hito en el desarrollo de la arquitectura occidental porque emplea todos los elementos estructurales de la nueva arquitectura gótica: el arco apuntado, la bóveda de crucería y paneles y, lo más importante, el arbotante.\",\"text2\":\"Debido a que la mayor parte de sus vidrieras y esculturas de los siglos XII y XIII sobreviven, la catedral de Chartres es una de las iglesias medievales más completamente sobrevivientes. Su intensidad espiritual se ve realzada por el hecho de que no entra luz directa en el edificio. Todo la luz se filtra a través de vidrieras, por lo que toda la experiencia de visitar la Catedral de Chartres parece fuera de este mundo.\",\"text3\":\"El interior de la catedral de Chartres es notable. La nave, más ancha que la de cualquier otra catedral en Francia (52 pies o 16 metros), es del más puro estilo ojival del siglo XIII. En su centro hay un laberinto, el único que queda intacto en Francia, con 320 yardas (290 metros) de pasadizos sinuosos, que los fieles solían seguir de rodillas.\"}}');\n\n//# sourceURL=webpack:///./content/architecture/exemple/the-chartres-cathedral.json?");

